function updateMap() {

    var that = this;

    // clear
    this.withAllSubmorphsDo(function(ea) {
        if(ea !== that) {
            ea.remove();
        }
    });

    //build structure
    var map = this.makeBox();
    $world.submorphs.forEach(function(ea) {
        if(!ea.isHalo && ea !== that) {
            map.addMorph(that.renderMiniMorph(ea, 0));
        }
    }); 
    map.ignoreEvents();
    this.addMorph(map);

    //build viewframe
    var viewPort = $world.visibleBounds();
    var viewFrame = new lively.morphic.Box(rect(0,0,10,10));
    var worldExtent = $world.getExtent();
    var myExtent = this.getExtent();
    var scaleFactor = pt(myExtent.x / worldExtent.x, myExtent.y / worldExtent.y);
    viewFrame.ignoreEvents();
    viewFrame.applyStyle({
        borderWidth: 1,
        borderColor: Color.red
    });
    viewFrame.setPosition(pt(
        viewPort.topLeft().x * scaleFactor.x,
        viewPort.topLeft().y * scaleFactor.y
    ));
    viewFrame.setExtent(pt(
        viewPort.width * scaleFactor.x,
        viewPort.height * scaleFactor.y
    ));
    map.addMorph(viewFrame);

}

