function renderMiniMorph(morph, depth) {
        var worldExtent = $world.getExtent();
        var myExtent = this.getExtent();
        var elementExtent = morph.getExtent();
        var elementPosition = morph.getPosition();
        var elementOrigin = morph.getOrigin();
        var elementRotation = morph.getRotation();
        var elementScale = morph.getScale();
        var elementBounds = morph.getBounds();
        var scaleFactor = pt(myExtent.x / worldExtent.x, myExtent.y / worldExtent.y);
        var box = this.makeBox();
        var that = this;
        box.disableGrabbing();
        box.disableHalos();
        box.ignoreEvents();

        if(depth < this.maxDepth) {
            //TODO: render using extent, position, origin and call for submorphs
            box.setOrigin(pt(
                scaleFactor.x * elementOrigin.x  ,
                scaleFactor.y * elementOrigin.y
            ));
            box.setPosition(pt(
                scaleFactor.x * elementPosition.x  ,
                scaleFactor.y * elementPosition.y
            ));
            box.setRotation(elementRotation);
            box.setScale(elementScale);
            box.setExtent(pt(
                scaleFactor.x * elementExtent.x  ,
                scaleFactor.y * elementExtent.y
            ));
            morph.submorphs.forEach(function(ea) {
                box.addMorph(that.renderMiniMorph(ea, depth + 1));
            });
        } else {
            box.setPosition(pt(
                scaleFactor.x * elementBounds.left()  ,
                scaleFactor.y * elementBounds.top()
            ));
            box.setExtent(pt(
                scaleFactor.x * elementBounds.width  ,
                scaleFactor.y * elementBounds.height
            ));
        }
        return box;
}

