function onClick(evt) {
    if (evt.isCommandKey()) return;
    var that = this;
    var mapPosition = this.getPosition();
    var mapExtent = this.getExtent();
    var worldExtent = $world.getExtent();
    var positionInMiniMap = this.localize(evt.getPosition());
    var normalizedPosition = pt(
        positionInMiniMap.x / mapExtent.x,
        positionInMiniMap.y / mapExtent.y
    );
    var positionInWorld = pt(
        normalizedPosition.x * worldExtent.x,
        normalizedPosition.y * worldExtent.y
    );
    var halfScreen = pt(
        $world.visibleBounds().width / 2,
        $world.visibleBounds().height / 2
    );
    var scrollOffset = positionInWorld.subPt(halfScreen);

    // we have to delay the scroll to prevent grabbing the mini map
    (function(){
        window.scrollTo(scrollOffset.x, scrollOffset.y);
        that.updateMap();
    }).delay(0);    
}

